import React, { useState } from 'react';

function Orcamento({ clienteId, onSalvarOrcamento }) {
  const [distancia, setDistancia] = useState('');
  const [quantidadeEletrocalha, setQuantidadeEletrocalha] = useState('');
  const [quantidadeDutoCanaduto, setQuantidadeDutoCanaduto] = useState('');
  const [quantidadeEletrodutoPVC, setQuantidadeEletrodutoPVC] = useState('');
  const [desviosCanaduto, setDesviosCanaduto] = useState('');
  const [desviosPVC, setDesviosPVC] = useState('');
  const [conduletes, setConduletes] = useState('');
  const [quantidadeCurvas, setQuantidadeCurvas] = useState('');
  const [observacao, setObservacao] = useState('');
  const [resultado, setResultado] = useState('');

  const calcularMateriais = () => {
    const centro = parseFloat(distancia);
    const eletrocalha = parseFloat(quantidadeEletrocalha);
    const dutoCanaduto = parseFloat(quantidadeDutoCanaduto);
    const eletrodutoPVC = parseFloat(quantidadeEletrodutoPVC);
    const desviosC = parseInt(desviosCanaduto);
    const desviosP = parseInt(desviosPVC);
    const conduletesQ = parseInt(conduletes);
    const curvas = parseInt(quantidadeCurvas);

    const totalGeral = centro + eletrocalha + dutoCanaduto + eletrodutoPVC;
    const margemSeguranca = Math.ceil(totalGeral * 1.1);
    const eletrodutoRigido = Math.ceil((eletrodutoPVC * 1.1) / 3.0);
    const luvas = (desviosC * 2) + eletrodutoRigido;
    const abracadeiras = (desviosC * 3) + (eletrodutoRigido * 3);
    const quantidadeConduletes = conduletesQ + (desviosP * 2);
    const curvap = curvas + (desviosP * 2);

    const resultadoTexto = `
      Resumo dos Materiais

      Total Geral: ${totalGeral.toFixed(2)} m
      Margem de Segurança: ${margemSeguranca.toFixed(2)} m
      Eletroduto Rígido: ${eletrodutoRigido} varas
      Duto Canaduto: ${dutoCanaduto.toFixed(2)} m
      Luvas: ${luvas}
      Abraçadeiras: ${abracadeiras}
      Conduletes: ${quantidadeConduletes}
      Curvas: ${curvap}
      Observação: ${observacao}
    `;

    setResultado(resultadoTexto);
  };

  const handleSalvar = () => {
    const orcamento = {
      clienteId,
      distancia,
      quantidadeEletrocalha,
      quantidadeDutoCanaduto,
      quantidadeEletrodutoPVC,
      desviosCanaduto,
      desviosPVC,
      conduletes,
      quantidadeCurvas,
      observacao,
      resultado
    };
    onSalvarOrcamento(orcamento);
  };

  return (
    <div>
      <h2>Criar Orçamento</h2>
      <div>
        <label>Distância (m):</label>
        <input type="number" value={distancia} onChange={(e) => setDistancia(e.target.value)} />
      </div>
      <div>
        <label>Quantidade de Eletrocalha (m):</label>
        <input type="number" value={quantidadeEletrocalha} onChange={(e) => setQuantidadeEletrocalha(e.target.value)} />
      </div>
      <div>
        <label>Quantidade de Duto Canaduto (m):</label>
        <input type="number" value={quantidadeDutoCanaduto} onChange={(e) => setQuantidadeDutoCanaduto(e.target.value)} />
      </div>
      <div>
        <label>Quantidade de Eletroduto PVC (m):</label>
        <input type="number" value={quantidadeEletrodutoPVC} onChange={(e) => setQuantidadeEletrodutoPVC(e.target.value)} />
      </div>
      <div>
        <label>Desvios Canaduto:</label>
        <input type="number" value={desviosCanaduto} onChange={(e) => setDesviosCanaduto(e.target.value)} />
      </div>
      <div>
        <label>Desvios PVC:</label>
        <input type="number" value={desviosPVC} onChange={(e) => setDesviosPVC(e.target.value)} />
      </div>
      <div>
        <label>Conduletes:</label>
        <input type="number" value={conduletes} onChange={(e) => setConduletes(e.target.value)} />
      </div>
      <div>
        <label>Quantidade de Curvas:</label>
        <input type="number" value={quantidadeCurvas} onChange={(e) => setQuantidadeCurvas(e.target.value)} />
      </div>
      <div>
        <label>Observação:</label>
        <textarea value={observacao} onChange={(e) => setObservacao(e.target.value)} />
      </div>
      <button onClick={calcularMateriais}>Calcular</button>
      <button onClick={handleSalvar}>Salvar Orçamento</button>
      <pre>{resultado}</pre>
    </div>
  );
}

export default Orcamento;
